import "./app.css";

function App() {

  const moneyPyramid=[
    {id:1,amount:"₹ 5000"}
  ]
  return (
    <div className="app">
      <div className="main">main</div>
      <div className="pyramid">
        <ul className="moneyList">
         <li className="moneyListItem active">
            <span className="moneyListItemNumber">4</span>
            <span className="moneyListItemAmount">$5000</span>
         </li>
        </ul>
      </div>
    </div>
  );
}

export default App;
